import { useState, useEffect } from 'react';
import { TreeTable } from 'primereact/treetable';
import { Column } from 'primereact/column';

export default function FullParameterList({ param_type }) {
    const [keyValuePairs, setKeyValuePairs] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        setLoading(true);

        if (param_type === 'full') {
            // Example data from params or your source
            const data = [
                {

                    "ACRO": [{
                        "ACRO_BAL": {
                            "PITCH": 1,
                            "ROLL": 1
                        },
                        "ACRO_OPTIONS": 0,
                        "ACRO_RP": {
                            "EXPO": 0.3,
                            "RATE": 360,
                            "RATE_TC": 0
                        },
                        "ACRO_THR": {
                            "MID": 0
                        },
                        "ACRO_TRAINER": 2,
                        "ACRO_Y": {
                            "EXPO": 0,
                            "RATE": 202.5,
                            "RATE_TC": 0
                        }
                    }],
                    // Add other parameters like "AHRS", "ARMING", etc.
                }
            ];

            const transformedData = transformDataToTree(data);
            setKeyValuePairs(transformedData);
            setLoading(false);
        } else {
            setKeyValuePairs([]);
            setLoading(false);
        }
    }, [param_type]);

    // Helper function to convert the flattened data into a tree structure
    const transformDataToTree = (data) => {
        const treeData = [];

        const flatten = (obj, parentKey = '', parentCategory = '') => {
            Object.keys(obj).forEach(key => {
                const newKey = parentKey ? `${parentKey}.${key}` : key;
                const newCategory = parentCategory ? `${parentCategory}.${key}` : key;

                if (typeof obj[key] === 'object' && obj[key] !== null) {
                    // Recursively process the nested object and assign the `children`
                    const children = flatten(obj[key], newKey, newCategory);
                    treeData.push({
                        key: newKey,
                        label: key,
                        category: parentCategory,
                        children: children
                    });
                } else {
                    treeData.push({
                        key: newKey,
                        label: key,
                        category: parentCategory,
                        value: obj[key]
                    });
                }
            });
            return treeData;
        };

        data.forEach(item => {
            const rootKey = Object.keys(item)[0];
            treeData.push({
                key: rootKey,
                label: rootKey,
                category: '',
                children: flatten(item[rootKey], rootKey, rootKey)
            });
        });

        console.log('Transformed Data:', treeData);  // Debugging: See the structure of the treeData
        return treeData;
    };

    return (
        <div className="card">
            {loading ? (
                <p>Loading data...</p>
            ) : keyValuePairs.length === 0 ? (
                <p>No data available.</p>
            ) : (
                <TreeTable value={keyValuePairs} tableStyle={{ minWidth: '50rem' }} paginator rows={10}>
                    <Column field="key" header="Key" />
                    <Column field="label" header="Name" />
                    <Column field="category" header="Category" />
                    <Column field="value" header="Value" />
                </TreeTable>
            )}
        </div>
    );
}
